"use strict";

function f(x){
  var y;
  var ys = [];
  var xs = x.split("").map(function(x){return parseInt(x);});
  for(var i=0;(i+12)<xs.length;i++){
    y = xs[i] * xs[i+1] * xs[i+2] * xs[i+3] * xs[i+4] * xs[i+5] * xs[i+6] * xs[i+7] * xs[i+8] * xs[i+9] * xs[i+10] * xs[i+11] * xs[i+12];
    ys.push(y);
  }
  console.log(ys);
   var max = ys[0];
  for (var j = 1; j < ys.length; j++){
    if (ys[j] > max) {
      max = ys[j];
    }
  }
  return max;
}

console.log(f(""));
